import React from "react";
import Navbar from "./components/Navbar";
import Main from "./components/Main";
import Data from "./components/Data";
import Grid from "./components/Grid";
function App() {
  const cardsfinal = Data.map((x, index) => {
    return (
      <div className="cards">
        <Grid
          key={index}
          image={x.image}
          title={x.title}
          rating={x.rating}
          rating_count={x.rating_count}
          region={x.region}
          price={x.price}
        />
      </div>
    );
  });
  return (
    <div>
      <Navbar />
      <Main />
      {cardsfinal}
    </div>
  );
}

export default App;
